const PassengerList = ({passengers, status}) => {
    return (
        <div className="pass-wrapper">
        {passengers.map((passenger) =>(
            <h3 key={passenger.id}>{passenger.nameFirst} {passenger.nameLast}</h3>
        ))}
        </div>
    )
}

export default PassengerList
